import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import NavbarIn from "./navbar/NavbarIn";

class Profile extends Component {
  constructor(props) {
    super();
    this.state = {};
  }

  render() {
    return (
      <div>
        <NavbarIn />
        <br />
        <br />
        <br />
        <h1 className="tc white i grow f1 font">My Profile</h1>
        <br />
        <br />
        <Container className='tc f3 solidBR'>
          <Row>
            
            <Col className="pa3 ba ma5">
              <u><i>Full Name<br/>
              Country of Residceny


              </i></u>
            </Col>

            <Col className="pa5">
              <u><i className='f2'>My Persinal Infomation</i></u> <br/>
              <a className='black hover' href="/">- View Persinal Data</a> <br/> 
              <a className='black hover' href="/">- Edit Persinal Data</a>  <br/> 
              <a className='black hover' href="/">- Delete your Account</a>
            </Col>
          </Row>
          <Row>
            <Col className="pa5">
              <u><i>Finacial Transactions</i></u>
            </Col>
            <Col className="pa5">
              <u><i>Finacial Transactions</i></u>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Profile;
